import React, { Component } from 'react'
import {Bar,Line,Pie} from 'react-chartjs-2'

const data = {
    labels: ['January', 'February', 'March', 'April', 'May', 'June', 'July'],
    datasets: [
      {
        label: 'My First dataset',
        fill: false,
        lineTension: 0.1,
        backgroundColor: 'rgba(75,192,192,0.4)',
        borderColor: 'rgba(75,192,192,1)',
        borderCapStyle: 'butt',
        borderDash: [],
        borderDashOffset: 0.0,
        borderJoinStyle: 'miter',
        pointBorderColor: 'rgba(75,192,192,1)',
        pointBackgroundColor: '#fff',
        pointBorderWidth: 1,
        pointHoverRadius: 5,
        pointHoverBackgroundColor: 'rgba(75,192,192,1)',
        pointHoverBorderColor: 'rgba(220,220,220,1)',
        pointHoverBorderWidth: 2,
        pointRadius: 1,
        pointHitRadius: 10,
        data: [65, 59, 80, 81, 56, 55, 40]
      }
    ]
  };

export default class FetchRandom extends Component {
    state = {
        loading : false,
        person: null,
        case : '',
    }
    async componentDidMount(){
        //const url = "https://www.fxempire.com/api/v1/en/stocks/chart/candles?Identifier=AAPL.XNAS&IdentifierType=Symbol&AdjustmentMethod=All&IncludeExtended=False&period=5&Precision=Minutes&StartTime=8/28/2020%2016:0&EndTime=9/4/2020%2023:59&_fields=ChartBars.StartDate,ChartBars.High,ChartBars.Low,ChartBars.StartTime,ChartBars.Open,ChartBars.Close,ChartBars.Volume";
        // const response = await fetch(url)
        // const data = await response.json()
        // console.log(data)
        // console.log(this.props.timeStamps)
        
    }
    render(){
        return (
            <div>
                {this.state.loading ? 
                <div>{this.props.timeStamps}</div> :
                <div>
                 <Line    
                    data={data}               
                    width={1000}
                    height={2000}
                    options={{ maintainAspectRatio: false }}
                />
                </div>}
            </div>
        )
    }
}
